import React from 'react';

import Router from './shared/Router';
declare global {
  interface Console {
    log: () => void;
    warn: () => void;
    error: () => void;
  }
}
const App = () => {
  if (process.env.NODE_ENV === 'production') {
    const emptyFunction = () => {};

    console = window.console || {};
    console.log = emptyFunction;
    console.warn = emptyFunction;
    console.error = emptyFunction;
  }
  return (
    <div>
      <Router />
    </div>
  );
};

export default App;
